import React from "react";
import { useForm, ValidationError } from "@formspree/react";
import gavatar from "./gavatar.jpeg";

function ContactForm() {
  const [state, handleSubmit] = useForm("xyybarqr");
  if (state.succeeded) {
    return <p>Thank You!</p>;
  }
  return (
    <div>
      <div className="group">
        <div className="item">
          <form onSubmit={handleSubmit}>
            <label htmlFor="email"></label>
            <input
              id="email"
              type="email"
              name="email"
              placeholder="your email"
            />
            <ValidationError
              prefix="Email"
              field="email"
              errors={state.errors}
            />
            <textarea id="message" name="message" placeholder="your message" />
            <ValidationError
              prefix="Message"
              field="message"
              errors={state.errors}
            />
            <button type="submit" disabled={state.submitting}>
              Submit
            </button>
            <button type="submit" disabled={state.submitting} style={{marginLeft: "265px"}}>
              Submit
            </button>
            <button type="submit" disabled={state.submitting}>
              Submit
            </button>
          </form>
        </div>
        <img src={gavatar} className="gImage"/>
      </div>

    </div>
  );
}

export default ContactForm;
